import React, {useState, useEffect} from 'react';

const TableWithCash = (Component, keyCash) => {
	const [items, setItems] = useState([]);

	useEffect(() => {
		const getDataFromLoacalStorage = localStorage.getItem(keyCash);
		const product = JSON.parse(getDataFromLoacalStorage);

		setItems({id: product.price, name: product.category, avatar: '/#'});
	}, [items.length]);
	// const cashTable = () => {
	// 	return <Component data={items} />;
	// };
	// return cashTable;
	return <Component data={items} />;
};
export default TableWithCash;
